import React, { useEffect, useContext } from 'react';
import { useLazyQuery } from '@apollo/react-hooks';
import PropTypes from 'prop-types';
import GET_RECOMMAND from './query';
import { CityContext, TotalContext } from '../../../../stores';
import HotelItem from './HotelItem';
import TourItem from './TourItem';
import Styled from 'styled-components';

const ListBody = Styled.ul`
  display: flex;
  flex: 1;
  flex-direction: column;
`;

const AttractionList = ({ currentTab }) => {
  const { city } = useContext(CityContext);
  const { currentHotel, currentTour } = useContext(TotalContext);
  const [getRecommand, { called, loading, error, data }] = useLazyQuery(GET_RECOMMAND, {
    variables: { airport: city.airport },
  });

  useEffect(() => {
    if (city) {
      getRecommand();
    }
  }, [city]);

  if (called && loading) return <p>Loading ...</p>;
  //   if (error) return <p>error</p>;

  const hotels = [
    {
      name: '호텔이름1',
      price: 500,
      rate: 9.9,
      image:
        'data:image/jpeg;base64,',
      _id: '1',
    },
    {
      name: '호텔이름2',
      price: 500,
      rate: 9.9,
      image:
        'data:image/jpeg;base64,',
      _id: '2',
    },
    {
      name: '호텔이름3',
      price: 500,
      rate: 9.9,
      image:
        'data:image/jpeg;base64,',
      _id: '3',
    },
    {
      name: '호텔이름4',
      price: 500,
      rate: 9.9,
      image:
        'data:image/jpeg;base64,',
      _id: '4',
    },
  ].map(({ name, price, rate, image, _id }) => {
    const selected = _id === currentHotel._id;
    return (
      <HotelItem
        key={_id}
        _id={_id}
        name={name}
        price={price}
        rate={rate}
        image={image}
        selected={selected}
      />
    );
  });

  const tours = [
    {
      _id: '1',
      name: '투어1',
      price: 5,
      rank: 2,
      image:
        'data:image/jpeg;base64,',
    },
    {
      _id: '2',
      name: '투어2',
      price: 5,
      rank: 2,
      image:
        'data:image/jpeg;base64,',
    },
  ].map(({ name, price, rank, image, _id }) => {
    const selected = _id === currentTour._id;
    return (
      <TourItem
        key={_id}
        _id={_id}
        name={name}
        price={price}
        rank={rank}
        image={image}
        selected={selected}
      />
    );
  });
  return (
    <ListBody>
      {currentTab === 'hotel' && hotels}
      {currentTab === 'tour' && tours}
    </ListBody>
  );
};

AttractionList.propTypes = {
  currentTab: PropTypes.string.isRequired,
};

export default AttractionList;
